	KERALARAASIHASH : {1 : "\u0d1a\u0d3f\u0d19\u0d4d\u0d19\u0d02 (\u0d32\u0d3f\u0d2f\u0d4b)",2 : "\u0d27\u0d28\u0d41 (\u0d38\u0d3e\u0d1c\u0d3f\u0d31\u0d4d\u0d31\u0d3e\u0d30\u0d3f\u0d2f\u0d38\u0d4d\u200c)",3 : "\u0d0e\u0d1f\u0d35\u0d02 (\u0d1f\u0d4c\u0d30\u0d4c\u0d38\u0d4d\u200c)",4 : "\u0d15\u0d28\u0d4d\u0d28\u0d3f (\u0d35\u0d3f\u0d30\u0d4d\u200d\u0d17\u0d4a)",5 : "\u0d15\u0d30\u0d4d\u200d\u0d15\u0d4d\u0d15\u0d3f\u0d1f\u0d15\u0d02 (\u0d15\u0d3e\u0d28\u0d4d\u200d\u0d38\u0d30\u0d4d\u200d)",6 : "\u0d15\u0d41\u0d02\u0d2d\u0d02 (\u0d05\u0d15\u0d4d\u0d35\u0d3e\u0d30\u0d3f\u0d38\u0d4d\u200c)",7 : "\u0d2e\u0d15\u0d30\u0d02 (\u0d15\u0d3e\u0d2a\u0d4d\u0d30\u0d3f\u0d15\u0d4d\u0d15\u0d4b\u0d23\u0d4d\u200d)",8 : "\u0d2e\u0d47\u0d1f\u0d02 (\u0d0f\u0d30\u0d40\u0d38\u0d4d\u200c)",9 : "\u0d2e\u0d40\u0d28\u0d02 (\u0d2a\u0d3f\u0d38\u0d40\u0d38\u0d4d\u200c)",10 : "\u0d2e\u0d3f\u0d25\u0d41\u0d28\u0d02 (\u0d1c\u0d46\u0d2e\u0d3f\u0d28\u0d3f)",11 : "\u0d24\u0d41\u0d32\u0d3e\u0d02 (\u0d32\u0d3f\u0d2c\u0d4d\u0d30)",12 : "\u0d35\u0d43\u0d36\u0d4d\u0d1a\u0d3f\u0d15\u0d02 (\u0d38\u0d4d\u0d15\u0d4b\u0d30\u0d4d\u200d\u0d2a\u0d3f\u0d2f\u0d4b)"},

